import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const About = () => {
  const [displayText, setDisplayText] = useState('');
  const fullText = "I am a Computer Science graduate passionate about software quality, UI design, and problem solving. I believe good software is built by good testing.";

  useEffect(() => {
    let index = 0;
    const timer = setInterval(() => {
      if (index < fullText.length) {
        setDisplayText(fullText.slice(0, index + 1));
        index++;
      } else {
        clearInterval(timer);
      }
    }, 50);

    return () => clearInterval(timer);
  }, []);

  return (
    <section className="py-32 px-4 relative overflow-hidden">
      {/* 3D Floating Background Elements */}
      <div className="absolute inset-0">
        {[...Array(15)].map((_, i) => (
          <motion.div
            key={i}
            className="absolute rounded-full opacity-20"
            style={{
              width: `${Math.random() * 200 + 100}px`,
              height: `${Math.random() * 200 + 100}px`,
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              background: `radial-gradient(circle, ${[
                'rgba(0, 243, 255, 0.2)',
                'rgba(191, 0, 255, 0.2)',
                'rgba(255, 0, 128, 0.2)'
              ][Math.floor(Math.random() * 3)]} 0%, transparent 70%)`,
              filter: 'blur(3px)'
            }}
            animate={{
              y: [-50, 50, -50],
              x: [-30, 30, -30],
              scale: [1, 1.3, 1],
              rotate: [0, 360],
            }}
            transition={{
              duration: 15 + Math.random() * 10,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          />
        ))}
      </div>

      <div className="max-w-7xl mx-auto relative z-10">
        <motion.h2 
          className="text-6xl md:text-8xl font-black text-center mb-20 ultra-sharp"
          initial={{ opacity: 0, y: 100, rotateX: -90 }}
          whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
          transition={{ duration: 1.5, ease: "easeOut" }}
          viewport={{ once: true }}
        >
          <span className="holo-text neon-text float-3d animate-rainbow-glow">
            About Me
          </span>
          {/* Enhanced glow layers */}
          <motion.div
            className="absolute inset-0 opacity-30 blur-lg"
            style={{
              background: 'linear-gradient(45deg, #ffd700, #ff1493, #00ffff, #39ff14)',
              backgroundClip: 'text',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent'
            }}
            animate={{ opacity: [0.2, 0.5, 0.2] }}
            transition={{ duration: 3, repeat: Infinity }}
          >
            About Me
          </motion.div>
        </motion.h2>

        <div className="grid lg:grid-cols-2 gap-16 items-center">
          {/* 3D Photo Section */}
          <motion.div
            className="relative"
            initial={{ opacity: 0, x: -100, rotateY: -45 }}
            whileInView={{ opacity: 1, x: 0, rotateY: 0 }}
            transition={{ duration: 1.5, ease: "easeOut" }}
            viewport={{ once: true }}
          >
            <div className="relative w-96 h-96 mx-auto transform-gpu">
              {/* Holographic Photo Frame */}
              <motion.div
                className="absolute inset-0 electric-border rounded-full animate-cosmic-rotate"
                animate={{
                  rotate: [0, 360],
                  scale: [1, 1.08, 1]
                }}
                transition={{
                  rotate: { duration: 15, repeat: Infinity, ease: "linear" },
                  scale: { duration: 5, repeat: Infinity, ease: "easeInOut" }
                }}
              />

              {/* Additional rotating rings */}
              <motion.div
                className="absolute inset-0 border-2 border-neon-gold rounded-full opacity-60"
                style={{ transform: 'scale(1.1)' }}
                animate={{ rotate: [360, 0] }}
                transition={{ duration: 20, repeat: Infinity, ease: "linear" }}
              />

              <motion.div
                className="absolute inset-0 border border-cosmic-pink rounded-full opacity-40"
                style={{ transform: 'scale(1.2)' }}
                animate={{ rotate: [0, 360] }}
                transition={{ duration: 25, repeat: Infinity, ease: "linear" }}
              />

              {/* 3D Photo Container */}
              <motion.div
                className="relative w-full h-full holo-card rounded-full overflow-hidden transform-gpu"
                whileHover={{ 
                  scale: 1.1,
                  rotateY: 15,
                  rotateX: 10,
                  boxShadow: '0 30px 80px rgba(0, 243, 255, 0.4)'
                }}
                transition={{ duration: 0.5, ease: "easeOut" }}
              >
                <img 
                  src="/yash-photo.jpg" 
                  alt="Yash Kumar Om"
                  className="w-full h-full object-cover transform-gpu"
                  style={{
                    filter: 'contrast(1.1) saturate(1.2) brightness(1.1)'
                  }}
                  onError={(e) => {
                    e.target.style.display = 'none';
                    e.target.nextSibling.style.display = 'flex';
                  }}
                />
                {/* Fallback gradient */}
                <div className="w-full h-full bg-gradient-to-br from-cyan-400 via-purple-500 to-pink-500 flex items-center justify-center text-6xl font-bold holo-text" style={{display: 'none'}}>
                  YKO
                </div>

                {/* Holographic Overlay */}
                <motion.div
                  className="absolute inset-0 bg-gradient-to-br from-cyan-400/20 via-transparent to-purple-500/20 opacity-0 hover:opacity-100 transition-opacity duration-500"
                />
              </motion.div>

              {/* Floating Rings */}
              {[...Array(4)].map((_, i) => (
                <motion.div
                  key={i}
                  className={`absolute inset-0 border rounded-full ${
                    i === 0 ? 'border-neon-gold' : 
                    i === 1 ? 'border-cosmic-cyan' : 
                    i === 2 ? 'border-cosmic-pink' : 'border-neon-lime'
                  }`}
                  style={{
                    transform: `scale(${1 + i * 0.12})`,
                    opacity: 0.6 - i * 0.1
                  }}
                  animate={{
                    rotate: [0, 360],
                    opacity: [0.2, 0.8, 0.2]
                  }}
                  transition={{
                    rotate: { duration: 12 + i * 3, repeat: Infinity, ease: "linear" },
                    opacity: { duration: 4 + i, repeat: Infinity, ease: "easeInOut" }
                  }}
                />
              ))}
            </div>
          </motion.div>

          {/* Enhanced Story Section */}
          <motion.div
            className="space-y-8"
            initial={{ opacity: 0, x: 100 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 1.2, ease: "easeOut" }}
            viewport={{ once: true }}
          >
            {/* Enhanced 3D Typing Animation */}
            <motion.div
              className="electric-border holo-card p-8 rounded-2xl backdrop-blur-xl transform-gpu animate-electric-pulse"
              whileHover={{ 
                scale: 1.05,
                rotateY: 8,
                boxShadow: '0 30px 80px rgba(255, 215, 0, 0.4), 0 0 100px rgba(0, 255, 255, 0.3)'
              }}
            >
              <div className="text-2xl text-white leading-relaxed min-h-[150px] ultra-sharp">
                <span className="holo-text animate-rainbow-glow">{displayText}</span>
                <motion.span
                  className="inline-block w-1 h-8 bg-neon-gold ml-2 electric-border animate-electric-pulse"
                  animate={{ opacity: [1, 0, 1] }}
                  transition={{ duration: 1, repeat: Infinity }}
                />
              </div>
            </motion.div>

            {/* 3D Key Points */}
            <div className="space-y-6">
              {[
                { icon: "ðŸŽ¯", text: "Passionate about Quality Assurance", color: "cyan" },
                { icon: "ðŸ’»", text: "Frontend Development Enthusiast", color: "purple" },
                { icon: "ðŸ”", text: "Detail-oriented Problem Solver", color: "pink" },
                { icon: "ðŸš€", text: "Always Learning New Technologies", color: "cyan" }
              ].map((item, index) => (
                <motion.div
                  key={index}
                  className="holo-card p-6 rounded-xl backdrop-blur-xl transform-gpu"
                  initial={{ opacity: 0, y: 50, rotateX: -30 }}
                  whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
                  transition={{ delay: index * 0.2, duration: 0.8 }}
                  viewport={{ once: true }}
                  whileHover={{ 
                    scale: 1.05, 
                    rotateY: 10,
                    boxShadow: `0 20px 40px rgba(${item.color === 'cyan' ? '0, 243, 255' : item.color === 'purple' ? '191, 0, 255' : '255, 0, 128'}, 0.3)`
                  }}
                >
                  <div className="flex items-center space-x-6">
                    <motion.span 
                      className="text-4xl"
                      whileHover={{ scale: 1.3, rotate: 10 }}
                      transition={{ duration: 0.3 }}
                    >
                      {item.icon}
                    </motion.span>
                    <span className="text-white text-lg font-medium ultra-sharp">{item.text}</span>
                  </div>
                </motion.div>
              ))}
            </div>

            {/* 3D Goal Statement */}
            <motion.div
